ExprLine.OrigStr:
DeclareType("GenData", "Item");
if (GenData)
	if (ItemType(GenData) = ItemTypeGem)
		if (GemType(GenData) = GemTypeEnhancement)
			GenSpriteSetEarlyOverrideBackgroundByRGBA(Self, "Icon_Upgrade_Mod_Enhancement", 255, 255, 255, 255);
		elif (GemType(GenData) = GemTypeArmoring)
			GenSpriteSetEarlyOverrideBackgroundByRGBA(Self, "Icon_Upgrade_Mod_Armoring", 255, 255, 255, 255);
		else
			GenSpriteSetEarlyOverrideBackgroundByRGBA(Self, "Icon_Upgrade_Mod_Core", 255, 255, 255, 255);
		endif
	else
		if (GenCheckItemRestrictions(GenData, BagIDOffense, UpgradeTypeTypePrimary))
			GenSpriteSetEarlyOverrideBackgroundByRGBA(Self, "Icon_Upgrade_Offense_Primary_Background", 255, 255, 255, 255);

		elif (GenCheckItemRestrictions(GenData, BagIDDefense, UpgradeTypeTypePrimary))
			GenSpriteSetEarlyOverrideBackgroundByRGBA(Self, "Icon_Upgrade_Defense_Primary_Background", 255, 255, 255, 255);

		elif (GenCheckItemRestrictions(GenData, BagIDUtility, UpgradeTypeTypePrimary))
			GenSpriteSetEarlyOverrideBackgroundByRGBA(Self, "Icon_Upgrade_Support_Primary_Background", 255, 255, 255, 255);

		elif (GenCheckItemRestrictions(GenData, BagIDOffense, UpgradeTypeTypeSecondary))
			GenSpriteSetEarlyOverrideBackgroundByRGBA(Self, "Icon_Upgrade_Offense_Secondary_Background", 255, 255, 255, 255);

		elif (GenCheckItemRestrictions(GenData, BagIDDefense, UpgradeTypeTypeSecondary))
			GenSpriteSetEarlyOverrideBackgroundByRGBA(Self, "Icon_Upgrade_Defense_Secondary_Background", 255, 255, 255, 255);

		elif (GenCheckItemRestrictions(GenData, BagIDUtility, UpgradeTypeTypeSecondary))
			GenSpriteSetEarlyOverrideBackgroundByRGBA(Self, "Icon_Upgrade_Support_Secondary_Background", 255, 255, 255, 255);
		else
			GenSpriteSetEarlyOverrideBackgroundByRGBA(Self, "Icon_Inventory_Device_Background", 255, 255, 255, 255);
		endif

		GenSetState(Self, ItemMissionGrantAvailable, ItemGetMissionGrant(Player, GenData) = "Available");
		GenSetState(Self, ItemMissionGrantRepeatable, ItemGetMissionGrant(Player, GenData) = "Repeatable");
		GenSetState(Self, ItemCostumeUnlock, ItemIsCostumeUnlock(Player, GenData));
		if (GenInState(Self, ItemCostumeUnlock))
			GenSetState(Self, ItemNewCostumeUnlock, ItemIsNewCostumeUnlock(Player, GenData));
			GenSetState(Self, ItemCostumeUnlock, not GenInState(Self, ItemNewCostumeUnlock));
		else
			GenSetState(Self, ItemNewCostumeUnlock, False);
		endif
	endif

else
	GenSendMessage(Self, "ClearItemBackground");
endif

DeclareType("GenData", "Item");
if (GenData)
	GenSendMessage(Self, "SetItemBackground");
	GenSetString(Self, "ItemTexture", GenGetItemIconTexName(GenData));
else
	GenSendMessage(Self, "ClearItemBackground");
	GenSetString(Self, "ItemTexture", "");
endif
